      case BC_ISLT:
      dasm_put(Dst, 10960);
      break;
      case BC_ISGE:
      dasm_put(Dst, 10965);
      break;
      case BC_ISLE:
      dasm_put(Dst, 10970);
      break;
      case BC_ISGT:
      dasm_put(Dst, 10975);
